    false,nt"url": null,nt"notes": "Single-beam bathymetry data along with
    DGPS navigation data was collected as part of the U.S. Geological Survey cruise
    K-2-94-HW. The cruise was conducted in Mamala Bay, Offshore Honolulu, Oahu, Hawaii
    from May 16 to May 23, 1994. The chief scientists were Mike Torresan and Monty Hampton
    from the USGS Coastal and Marine Geology office in Menlo Park, CA. The purpose of
    this cruise was to sample and groundtruth the 1993 Acoustic data of the seafloor
    of Mamala Bay over the US Corps of Engineers Deep Ocean dredged material disposal
    sites used by Pearl and Honolulu Harbors. The geophysical source is a 12 kilohertz
    (kHz) Raytheon DSF-6000 fathometer. These data are reformatted from space-delimited
    ASCII text files located in the Coastal and Marine Geology Program (CMGP) InfoBank
    field activity catalog at http://walrus.wr.usgs.gov/infobank/k/k294hw/html/k-2-94-hw.meta.html
    into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
    The MGD77T format includes a header (documentation) file (.h77t) and a data file
    (.m77t). More information regarding this format can be found in the publication
    listed in the Cross_reference section of this metadata file.",nt"owner_org":
